import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
background-color: #dbdbdb;
`;

export const Form = styled.View`
position: absolute;
margin-top: 10px;
width: 100%;
height: 100%;
align-items: center;
`;

export const ContainerInput = styled.View`
display: flex;
flex-direction: row;
width: 90%;
min-height: 40px;
border-width: 1px;
border-color: #677689;
align-items: center;
`;

export const Input = styled.TextInput`
background-color: #dbdbdb;
color: #677689;
width: 50%;
height: 45px;
border-radius: 2px;
text-align: center;
`;

export const ContainerLab = styled.View` 
color: #677689;
width: 50%;
height: 45px;
font-size: 20px;
font-weight: bold;
text-align: center;

border-width: 1px;
`;

export const InputLab = styled.Text` 
color: #677689;
width: 50%;
font-size: 20px;
font-weight: bold;

border-width: 1px;
`;
